import React from "react";
import {
  Button,
  Navbar,
  Nav,
  NavDropdown,
  Form,
  FormControl,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class NavBar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Navbar fixed="top" className="portfolioNavbar" expand="md">
        <Navbar.Brand className="navbarText" href="#home">
          Stephen Doyle
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav>
            <Nav.Link className="navbarText" href="#about">
              About
            </Nav.Link>
            <Nav.Link className="navbarText" href="#projects">
              Projects
            </Nav.Link>
            <Nav.Link className="navbarText" href="#articles">
              Articles
            </Nav.Link>
            <Nav.Link className="navbarText" href="#resources">
              Resources
            </Nav.Link>
            <Nav.Link className="navbarText" href="#contact">
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
